<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Thaloria Region - Interactive Map</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 20px;
        }

        h1 {
            color: #ffd700;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.5);
            margin-bottom: 10px;
            font-size: 2rem;
        }

        .subtitle {
            color: #88c8ff;
            margin-bottom: 20px;
            font-size: 0.9rem;
            text-align: center;
        }

        .map-container {
            position: relative;
            width: 100%;
            max-width: 1200px;
            border: 4px solid #ffd700;
            border-radius: 15px;
            overflow: hidden;
            box-shadow: 0 10px 40px rgba(0,0,0,0.5);
        }

        .map-image {
            width: 100%;
            height: auto;
            display: block;
        }

        .location-node {
            position: absolute;
            width: 26px;
            height: 26px;
            border-radius: 50%;
            cursor: pointer;
            transform: translate(-50%, -50%);
            transition: all 0.3s ease;
            z-index: 10;
            border: 3px solid #fff;
        }

        .node-unvisited {
            background: radial-gradient(circle, #888 0%, #555 100%);
            box-shadow: 0 0 8px rgba(100, 100, 100, 0.5);
            opacity: 0.7;
        }

        .node-current {
            background: radial-gradient(circle, #f5a962 0%, #cc8844 100%);
            box-shadow: 0 0 20px rgba(245, 169, 98, 0.8);
            opacity: 1;
            animation: pulse-orange 1.5s ease-in-out infinite;
        }

        @keyframes pulse-orange {
            0%, 100% { 
                box-shadow: 0 0 15px rgba(245, 169, 98, 0.6);
                transform: translate(-50%, -50%) scale(1);
            }
            50% { 
                box-shadow: 0 0 30px rgba(245, 169, 98, 1);
                transform: translate(-50%, -50%) scale(1.15);
            }
        }

        .node-selected {
            background: radial-gradient(circle, #00ff88 0%, #00b894 100%);
            box-shadow: 0 0 25px rgba(0, 255, 136, 0.9);
            opacity: 1;
            transform: translate(-50%, -50%) scale(1.2);
        }

        .node-visited {
            background: radial-gradient(circle, #74b9ff 0%, #0984e3 100%);
            box-shadow: 0 0 10px rgba(116, 185, 255, 0.6);
            opacity: 0.9;
        }

        .location-node:hover {
            transform: translate(-50%, -50%) scale(1.4);
            z-index: 15;
        }

        .node-selected:hover {
            transform: translate(-50%, -50%) scale(1.4);
        }

        .node-label {
            position: absolute;
            top: -30px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 11px;
            color: #fff;
            background: rgba(0,0,0,0.85);
            padding: 4px 8px;
            border-radius: 4px;
            white-space: nowrap;
            opacity: 0;
            transition: opacity 0.2s;
            pointer-events: none;
            border: 1px solid #ffd700;
            font-weight: bold;
        }

        .location-node:hover .node-label {
            opacity: 1;
        }

        .info-panel {
            position: fixed;
            bottom: 20px;
            left: 50%;
            transform: translateX(-50%);
            background: linear-gradient(145deg, rgba(0, 80, 60, 0.95), rgba(0, 60, 40, 0.95));
            border: 3px solid #00ff88;
            border-radius: 15px;
            padding: 20px;
            min-width: 350px;
            max-width: 90%;
            color: #fff;
            z-index: 50;
            box-shadow: 0 10px 30px rgba(0, 255, 136, 0.3);
            display: none;
        }

        .info-panel.visible {
            display: block;
            animation: slideUp 0.3s ease;
        }

        @keyframes slideUp {
            from { transform: translateX(-50%) translateY(20px); opacity: 0; }
            to { transform: translateX(-50%) translateY(0); opacity: 1; }
        }

        .info-panel h2 {
            color: #00ff88;
            margin-bottom: 10px;
            font-size: 1.4rem;
        }

        .info-panel .location-type {
            display: inline-block;
            font-size: 11px;
            padding: 4px 10px;
            border-radius: 20px;
            background: #00b894;
            color: #fff;
            margin-left: 10px;
            vertical-align: middle;
        }

        .info-panel p {
            color: #ccc;
            margin-bottom: 10px;
            line-height: 1.5;
        }

        .info-panel .features {
            color: #74b9ff;
            font-size: 0.9rem;
        }

        .btn-close {
            position: absolute;
            top: 10px;
            right: 10px;
            background: none;
            border: none;
            color: #fff;
            font-size: 20px;
            cursor: pointer;
            opacity: 0.7;
        }

        .btn-close:hover { opacity: 1; }

        .status-bar {
            background: rgba(0,0,0,0.7);
            padding: 12px 25px;
            border-radius: 10px;
            margin-top: 20px;
            color: #fff;
            display: flex;
            align-items: center;
            gap: 15px;
            border: 2px solid #f5a962;
        }

        .status-bar .current-location {
            color: #f5a962;
            font-weight: bold;
        }

        .legend {
            display: flex;
            gap: 20px;
            margin-top: 15px;
            flex-wrap: wrap;
            justify-content: center;
        }

        .legend-item {
            display: flex;
            align-items: center;
            gap: 8px;
            color: #fff;
            font-size: 13px;
        }

        .legend-dot {
            width: 18px;
            height: 18px;
            border-radius: 50%;
            border: 2px solid #fff;
        }
    </style>
</head>

        const locationIds = new Set(locations.map(function(location) { return location.id; }));

        // ============================================================
        // GAME STATE
        // ============================================================
        let currentLocationId = 'sproutshore';
        let selectedLocationId = null;
        let visitedLocations = new Set(['sproutshore']);

        // ============================================================
        // CREATE MAP NODES
        // ============================================================
        function createMapNodes() {
            const container = document.getElementById('mapContainer');
            
            locations.forEach(location => {
                const node = document.createElement('div');
                node.className = 'location-node';
                node.id = `node-${location.id}`;
                node.style.left = `${location.x}%`;
                node.style.top = `${location.y}%`;
                node.dataset.locationId = location.id;
                
                const label = document.createElement('span');
                label.className = 'node-label';
                label.textContent = location.name;
                node.appendChild(label);
                
                node.addEventListener('click', () => selectLocation(location.id));
                container.appendChild(node);
            });
            
            updateAllNodeStates();
        }

        // ============================================================
        // UPDATE NODE COLORS
        // ============================================================
        function updateAllNodeStates() {
            locations.forEach(location => {
                const node = document.getElementById(`node-${location.id}`);
                if (!node) return;
                
                node.classList.remove('node-unvisited', 'node-current', 'node-selected', 'node-visited');
                
                if (location.id === selectedLocationId) {
                    node.classList.add('node-selected');
                } else if (location.id === currentLocationId) {
                    node.classList.add('node-current');
                } else if (visitedLocations.has(location.id)) {
                    node.classList.add('node-visited');
                } else {
                    node.classList.add('node-unvisited');
                }
            });
            
            const currentLoc = locations.find(l => l.id === currentLocationId);
            if (currentLoc) {
                document.getElementById('currentLocationText').textContent = currentLoc.name;
            }
        }

        // ============================================================
        // SELECT LOCATION
        // ============================================================
        function selectLocation(locationId) {
            const location = locations.find(loc => loc.id === locationId);
            if (!location) return;

            selectedLocationId = locationId;
            updateAllNodeStates();

            document.getElementById('infoPanelTitle').textContent = location.name;
            document.getElementById('infoPanelType').textContent = location.type;
            document.getElementById('infoPanelDescription').textContent = location.description;

            const featuresEl = document.getElementById('infoPanelFeatures');
            if (location.features && location.features.length > 0) {
                featuresEl.innerHTML = '<strong>Features:</strong> ' + location.features.join(' ‚Ä¢ ');
            }

            document.getElementById('infoPanel').classList.add('visible');
        }

        // ============================================================
        // CLOSE PANEL
        // ============================================================
        function closeInfoPanel() {
            document.getElementById('infoPanel').classList.remove('visible');
            selectedLocationId = null;
            updateAllNodeStates();
        }

        // ============================================================
        // INIT
        // ============================================================
        function init() {
            const mapImage = document.getElementById('mapImage');
            if (mapImage.complete) {
                createMapNodes();
            } else {
                mapImage.addEventListener('load', createMapNodes);
            }
            
            document.getElementById('btnClose').addEventListener('click', closeInfoPanel);
            
            document.addEventListener('click', (e) => {
                if (!e.target.closest('.location-node') && !e.target.closest('.info-panel')) {
                    closeInfoPanel();
                }
            });
        }

        init();

        // ============================================================
        // API FOR YOUR GAME
        // ============================================================
        window.ThaloriaMap = {
            getCurrentLocation: () => currentLocationId,
            setPlayerLocation: (id) => {
                const loc = locations.find(l => l.id === id);
                if (loc) {
                    visitedLocations.add(id);
                    currentLocationId = id;
                    updateAllNodeStates();
                    return true;
                }
                return false;
            },
            getLocation: (id) => locations.find(l => l.id === id),
            getAllLocations: () => locations,
            getVisitedLocations: () => Array.from(visitedLocations),
            markVisited: (id) => {
                if(!locationIds.has(id)) return;
                visitedLocations.add(id);
                updateAllNodeStates();
            },
            applyState: (state) => {
                if(!state || typeof state !== 'object') return;
                if(Array.isArray(state.visited)) {
                    visitedLocations = new Set();
                    state.visited.forEach(id => {
                        if(locationIds.has(id)) visitedLocations.add(id);
                    });
                } else if(state.visited && typeof state.visited === 'object') {
                    visitedLocations = new Set();
                    Object.keys(state.visited).forEach(id => {
                        if(state.visited[id] && locationIds.has(id)) {
                            visitedLocations.add(id);
                        }
                    });
                }
                if(state.current && locationIds.has(state.current)) {
                    currentLocationId = state.current;
                }
                selectedLocationId = null;
                updateAllNodeStates();
            }
        };
    </script>
